export default function LeftSide() { 
    return (
        <div class="fullLeftSIde">
        <div class="header">Header</div>
        <div class="left_side">Left Side</div>
        <div class="right_side">Right Side</div>
        <div class="footerLeftSide">Footer</div>
      </div>
    )
}
